Votacao.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

contract Votacao {

    mapping(string => uint) public candidatos;

    constructor(string memory _voto) {
        candidatos['joao'] = 0;
        candidatos['jose'] = 0;
        candidatos['fabio'] = 0;
    }

    function votar(string memory _candidato) public {
        candidatos[_candidato] += 1;
    }
}

